import * as React from "react";
import { TypographySmall } from "@/components/typography";

interface IconBaseProps {
  el: React.ReactNode;
  label: string;
  className?: string;
}

function IconBase({ el, label, className }: IconBaseProps) {
  return (
    <div
      className={`flex align-center items-center gap-x-2 mb-6 md:mb-0 ${className}`}
    >
      <svg
        className={`h-5 w-5 fill-black dark:fill-white`}
        viewBox="0 0 128 128"
      >
        {el}
      </svg>
      {!!label && <TypographySmall>{label}</TypographySmall>}
    </div>
  );
}

